import React from 'react'
import banner from '../../../asset/image/homebanner.webp';

export default function Homeslide() {
    return (
        <div>
            <div>
                <div>
                    <img src={banner} alt='banner' className='w-full h-full' />
                </div>
            </div>

        </div>
    )
}
